<script>
  import nav_title from './basics_bar'
  import Sender from '../../Sender/sender'
  import cfg from '../../../.cfg'

  export default ({
    name: 'basics2',
    data() {
      return {
        dialogImageUrl: '',
        dialogVisible: false,
        token: {
          token: ''
        },
        number: 3,
        img_number: 0,
        page: 1,
        plan__: 20,
        plan_tr: true,
      }
    },
    components: {
      nav_title: nav_title,
    },
    methods: {
      page_minus: function () {
        this.page--;
      },
      page_add: function () {
        this.page++;
      },
      handleRemove(file, fileList) {
        console.log(file, fileList);
      },
      handlePictureCardPreview(file) {
        this.dialogImageUrl = file.url;
        this.dialogVisible = true;
      },
      test: function (response, file, fileList) {
        let img_path = 'http://ovygmwfnp.bkt.clouddn.com/' + response.key;
        this.new_house.photo.push(img_path);
      },
      max_img() {
        this.open4();
      },
      open4() {
        this.$notify({
          title: '图片数量超出',
          message: '最多上传8张图片,您不能在上传了',
          type: 'warning'
        });
      },
    },
    created() {
      let me = this;
      Sender.post(cfg.api + '/api/house/qiniu')
        .then(function (data) {
          me.token.token = data;
        })
    },
    computed: {
      new_house: function () {
        return this.$store.getters['get_new_house']
      },
      get_user() {
        return this.$store.getters['get_user'];
      }
    },
    watch: {
      page: function (val) {
        if (val == 2) {
          this.plan__ = 50;
        } else if (val == 3) {
          this.plan__ = 80;
        }else if (val == 4) {
          this.plan__ = 100;
        }

      },
      'new_house.house_title': {
        handler() {
          let me = this;
          if (this.new_house.house_title == '') {
            me.plan_tr = true
          } else {
            me.plan_tr = false;
          }
        },
        deep: true,
      },
    },

  })

</script>
